            }
            else {
                console.log('error');
            }
        };
    }
    showLoadWindow() {
        if (this.loadFile) {
            if (this.loadFile.nativeElement.classList.contains('displayNone')) {
                this.loadFile.nativeElement.classList.remove('displayNone');
            }
            else {
                this.loadFile.nativeElement.classList.add('displayNone');
            }
        }
    }
